legend( h, 'untitled fit 1', 'J2 vs. yy, xx', 'Location', 'NorthEast' );
% Label axes
xlabel( 'Pixeles' );
ylabel( 'Pixeles' );
zlabel( 'Intensidad' );
grid on
view( -47.5, 28 );


